# count number of names start with "Z"
def name_start_z(characters):
    z_count = 0
    for i in characters:
        if i["name"].startswith("Z"):
            z_count += 1
    return z_count

print("%d names start with \"Z\"." % name_start_z(characters))

# count number of people died
def dead(characters):
    dead_counter = 0
    for i in characters:
        if i["died"] != "":
            dead_counter += 1
    return dead_counter

print("%d people died." % dead(characters))

# get name of person with most titles
def title(characters):
    number_title = 0
    name_title = ""
    for i in characters:
        if len(i["titles"]) > number_title:
            number_title = len(i["titles"])
            name_title = i["name"]
    return [number_title, name_title]

name_title = title(characters)
print("%s has %d titles." % (name_title[1], name_title[0]))
            
