# get allegiances url from characters.py and convert the lists to a list with strings
def houses(characters):
    house = ""
    counter = 0
    for k in characters:
        if k['allegiances'] != []:
            while counter < len(k['allegiances']):
                house += (k['allegiances'][counter] + " ")
                counter += 1
            counter = 0
    house_list = house.rstrip(" ").split()
    return house_list

house = houses(characters)

